// this is the index page. where your user will see user profile, 

const React = require('react');
const DefaultLayout = require('./layouts/Default')

class Index extends React.Component{

    render(){
        const {users} = this.props;
        console.log(users);
        return(

            <DefaultLayout title={"User profile index"}>
                <ul>
                {users.map((user, i) =>{
                    return (
                    <li key={i}>
                                  <nav>
                <a href="/users/new">New Entry</a>
            </nav>
                        {/* eachuser */}
                        Here is list of users :
                        <a href={`/users/${user.id}`}>
                        {user.username}
                        </a>
                        {/* user name is ___ and is / isnt eligible to graduate*/}

                        {/* =======EDIT */}
                            <a href={`users/${user._id}/edit`}>
                              <br />
                            Edit user
                            </a>

                        {/* =====Delete */}
                        <form
                  action={`/users/${user._id}?_method=DELETE`}
                  method="POST"
                >
                  <input type="submit" value="DELETE" />
                </form>
              </li>
            );
          })}
        </ul>
      </DefaultLayout>
    );
  }
}
module.exports = Index

